import React,{Component} from 'react';
import * as googlePlacesFuncs from "../../lib/googlePlaceFunctions"
import Script from 'react-load-script';

import {SearchBar} from "../components"

class GoogleMapsSearchBar extends Component{
  state ={
      address:""
  }
  render(){
    return(
      <div>
        <Script
          url="https://maps.googleapis.com/maps/api/js?key=AIzaSyBWcDVGfs8R5EmWbh9xsuYEHycoqDyDf9I&libraries=places"
          onLoad={googlePlacesFuncs.handleScriptLoad}
          />  
        <SearchBar value={this.state.address} id="autocomplete" style={{ backgroundColor:"#fffffa"}} />
      </div>)
  }
}

export default GoogleMapsSearchBar
